import logo from './logo.svg';
import './App.css';
import { Router } from 'express';
import {Register} from '../src/components/Register'

function App() {
  return (
    <Router>
      <div className="App">
        <Router>
          <Router path="/" element={<Register />} />
        </Router>
      </div>
    </Router>
  );
}

export default App;
